/**
 * WebSocket
 */
class WebSocketClient {
  /**
   * 
   * @param serverAddress 
   */
  constructor(url) {
    this.heartBeatTimer = null;
    this.messageMap = {};
    this.connState = 0;
    this.socket = null;
    this.url = url;
  }

  doOpen() {
    if (this.connState) return;
    this.connState = 1;
    this.afterOpenEmit = [];
    const BrowserWebSocket = window.WebSocket || window.MozWebSocket;
    const socket = new BrowserWebSocket(this.url);
    socket.binaryType = 'arraybuffer';

    socket.onopen = evt => this.onOpen(evt);

    socket.onclose = evt => this.onClose(evt);

    socket.onmessage = evt => this.onMessage(evt.data);

    socket.onerror = err => this.onError(err);

    this.socket = socket;
  }

  onOpen(evt) {
    this.connState = 2;
    this.heartBeatTimer = setInterval(this.checkHeartbeat.bind(this), 20000);
    this.onReceiver({
      Event: 'open'
    });
  }

  checkOpen() {
    return this.connState === 2;
  }

  onClose() {
    this.connState = 0;

    if (this.connState) {
      this.onReceiver({
        Event: 'close'
      });
    }
  }

  send(data) {
    this.socket.send(JSON.stringify(data));

    if (this.socket.bufferedAmount === 0) {// 
      // console.log('')
    } else {// 
        // console.log('')
      }
  }

  emit(data) {
    return new Promise(resolve => {
      this.socket.send(JSON.stringify(data));
      this.on('message', data => {
        resolve(data);
      });
    });
  }

  onMessage(message) {
    try {
      const data = JSON.parse(message);
      this.onReceiver({
        Event: 'message',
        Data: data
      });
    } catch (err) {
      console.error(' >> Data parsing error:', err);
    }
  }

  checkHeartbeat() {
    const data = {
      "Key": "Ping"
    };
    this.send(data);
  }

  onError(err) {}

  onReceiver(data) {
    const callback = this.messageMap[data.Event];
    if (callback) callback(data.Data);
  }

  on(name, handler) {
    this.messageMap[name] = handler;
  }

  doClose() {
    this.socket.close();
  }

  destroy() {
    if (this.heartBeatTimer) {
      clearInterval(this.heartBeatTimer);
      this.heartBeatTimer = null;
    }

    this.doClose();
    this.messageMap = {};
    this.connState = 0;
    this.socket = null;
  }

}
